import Pic from "../../../images/default-card-picture.png";

const ActivityCard = () => {
    return (
        <div className="ActivityBox m-2">
            <div className="imgBox">
                <img src={Pic}/>
            </div>
            <div className="ActivityContent px-4 py-3">
                <span className="date">2021/10/30 - 2021/11/13</span>
                <h5 className="BoxTitle">2021 日月潭花火音樂節</h5>
                <span className="ActivityLocate"><i className="fas fa-map-marker-alt"></i> 南投縣</span>
                {/* <a className="moreBtn green">詳細介紹</a> */}
            </div>
        </div>
    );
  };

export default ActivityCard;
